import React from 'react'
import { FlexCol, PaddingX } from '../constants/style'
import { Fade, Slide } from 'react-reveal';
import { useRoutes, usePath } from 'react-router-dom';

export default function Header() {
  const path = usePath();
  const isHome = useRoutes([
    { path: '/', element: true }, // Check if current path is '/'
  ]);

  return (
    <Slide top cascade>
      <div className={`${FlexCol} bg-background relative pt-[66px] pb-[150px] pl-[102px] `}>
          <img src='../images/logo.png' className={`w-[270px] h-[62px]`}/>
          {isHome && path === '/' && 
          
          <p>여기다가</p>
          
          }
      </div>
    </Slide>
  )
}
